import './Nav.css'
function Nav(){
    return(

           <div class="jumbotron jumbotron-fluid">
                <div class="container">
                    <h1 class="display-4">Plant Disease Detection Using ML</h1>
                    <form> 
                         <p class="lead">Upload Image or Capture a image to know the Disease</p>
                         <p>Upload Image</p>
                         <input type="radio" name="rad" id="1" />
                         <p>Capture Image</p>
                    </form>
                </div>
            </div>

    );
}
export default Nav;
